import React from 'react';
import {
  Routes,
  Route,
  useMatch
} from "react-router-dom";

import Game from './components/game.jsx';
import BonesCafe from './games/bonesCafe.jsx'

function Games() {
  let match = useMatch();
  console.log(match.url);
  return (
    <div>
      <br/>
      <main className="container flex flexWrap alignCenter">
        <Game name="Bones Cafe" src="bonescafe/bones_card.png"/>
      </main>

      <Routes>
        <Route path={`${match}/Bones Cafe`} element={<BonesCafe/>}/>
      </Routes>
    </div>
  );
}

export default Games;
